import math
s = ""
a = []
for i in range(0, len(s)):
    if s[i] == "0":
        pass
    else:
        for j in range(i+1, len(s)+1):
            k = int(s[i:j])
            # print(k)
            l = math.log(k, 2)
            # print(l)
            m = math.floor(l)
            if l-m == 0 and m <= 800:
                a.append(k)

print(len(a))

# end
